import axios from "axios";

const baseURL = "http://localhost:8080/api/";

const axiosClient = axios.create({
  baseURL: baseURL
});

const apiClient = axios.create({
  baseURL: "https://apilayer.net/api/convert?"
});

export default axiosClient;
